Dessa feita, todo e qualquer cidadão tem direito à saúde, sendo o Poder Público responsável obrigacional pelo atendimento deste direito de caráter fundamental e indisponível;

Considerando então que a saúde, garantia fundamental assegurada pela Constituição Federal, é um direito de todos e dever do Estado, é evidente a responsabilidade do Estado pela manutenção da vida, saúde e dignidade do paciente, devendo este ente tomar as providências necessárias para suprir a necessidade dos pacientes, visto que o acesso à saúde é universal e igualitário, devendo todos serem atendidos isonomicamente, independentemente da natureza da doença da portadora, do tipo de medicamento que se necessite ou da espécie de procedimento que precise, sob pena de violação do direito constitucional da isonomia;

As decisões constantes nos autos judiciais, conforme especificado no Documento de Oficialização de Demanda - DOD  21 (0046627265)  e Informação 1687 (0052659907) determinam que o Estado de Rondônia viabilize os meios necessários à realização, junto a rede pública ou unidade particular, para a realização do acompanhamento em prol dos pacientes, uma vez que  não está sendo ofertado, no momento pelo ente público;

Diante do exposto, é necessária a realização das terapias, com maior brevidade, para que seja garantido o direito a vida, dignidade da pessoa humana, bem como o acesso à saúde da paciente; 

Sendo assim, processo de contratação em apreço foi instaurado com intuito de cumprir determinações judiciais, relacionadas a serviços de saúde que não estão sendo oferecidos por meio da rede pública de saúde. Quanto ao cumprimento de decisões judiciais, o Parecer nº 123/2023/PGE-SESAU elucida o seguinte:

O descumprimento da decisão judicial pode ensejar a imputação de ato atentatório à jurisdição, caso se crie embaraço ao cumprimento do mandamento jurisdicional, ou mesmo crime de
desobediência ou, ainda, a prática de ato de improbidade administrativa a depender das circunstâncias do caso concreto.

