CONTRATAÇÃO DE EMPRESA ESPECIALIZADA EM REALIZAR ACOMPANHAMENTO COM NEUROPSICÓLOGO, VISANDO O CUMPRIMENTO DE DEMANDA JUDICIAL.

Dessa maneira, a Constituição assegura ao paciente o acesso igualitário à saúde, recaindo este ônus sobre as pessoas de direito público e seus órgãos, especialmente criados para este fim, conforme prevê o Art. 6 e 196 do referido dispositivo;

O art. 6ª da Constituição Federal de 1988, prevê que o direito à saúde é um direito social, sendo, antes de tudo, um direito fundamental, tendo ainda o art. 196, da CF determinado ser a saúde um direito de todos e dever do Estado, garantindo mediante políticas sociais e econômicas que visem o acesso universal e igualitário às ações e serviços para sua promoção, proteção e recuperação, de forma que se sobrepõe a meros obstáculos administrativos;

Ademais, a dignidade da pessoa humana consiste em fundamento constitucional previsto no art. 1°, III, da CF/88, sendo a construção de uma sociedade livre, justa e solidária um dos objetivos da República Federativa do Brasil (art. 3º, I, CF). Sendo assim, o Direito à Vida se traduz como o maior de todos os direitos e sua relevância é tamanha a ponto de constar expressamente no caput do art. 5º, da CF. Sendo, inclusive, pré-requisito a existência e exercício de os demais direitos, sobretudo do direito à saúde, e exatamente por essa razão, precisa ser garantido com absoluta primazia sob os demais; 

Além das garantias constitucionais, a Lei n° 8.080 de 1990, ao dispor sobre as condições para promoção, proteção e recuperação da saúde, a organização e o funcionamento dos serviços correspondentes assegura a todo indivíduo o direito fundamental da saúde, cabendo ao Estado e ao Município prover as condições indispensáveis ao seu pleno exercício, determinado, inclusive, quais são os princípios e diretrizes do Sistema Único de Saúde - SUS, conforme art. 7º da referida Lei, bem como inclui a universalidade de acesso aos serviços de saúde em todos os níveis de assistência (art. 7, I).

